import React from "react";


function ContactHeader() {
    return (
        <header className="header-contact">
            <h2 className="contact-en">CONTACT</h2>
            <h3 className="contact-ja" lang="ja">コンタクト</h3>
        </header>
    );
}

export default ContactHeader;
